import React from "react";
import { withRouter, Link } from "react-router-dom";

function Intro() {
  return (
    <>
    <div className="fade">
      <div className="container">

        <Link to="/xmaspiano">
            Pai Natal
        </Link>
        </div>
      </div>
    </>
  );
}

export default withRouter(Intro);
